import {
  createBrowserRouter,
  RouterPRovider,
  Route
} from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/",
    element: <div>Hello World!</div>,
  },
]);

function App () {
  return (
   <div>
    <RouterPRovider router={router}/>
   </div>
  );
}

export default App;
